function Food({name,picture}) {

  return (
  <div>
    <h2>I love {name}</h2>
    <img src={picture} alt={name} />
  </div>
  );
}
const foodLike = [
  { id : 1,
    name : 'kimchi',
    image: 'https://health.chosun.com/site/data/img_dir/2021/09/01/2021090100998_0.jpg'},
