    name : 'kim',
    image: 'https://health.chosun.com/site/data/img_dir/2021/09/01/2021090100998_0.jpg'},
  { id : 3,
    name : 'kimchi',
    image: 'https://health.chosun.com/site/data/img_dir/2021/09/01/2021090100998_0.jpg'},

];

function App() {
  return (
    <div>
      {foodLike.map(dish => (
      <Food key={dish.id} name={dish.name} picture={dish.image} />))}

    </div>
    );
}

export default App;
